import React from "react";
import styled from "styled-components";
import Link from "next/link";

const NavStyle = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 0 10%;
  background: teal;

  a {
    padding: 0 1em;
    text-decoration: none;
    color: white;
  }
`;

const Nav = () => {
  return (
    <NavStyle>
      <p>Car Trader</p>
      <div>
        <Link className='link' href='/'>
          <a>Home</a>
        </Link>
        <Link className='link' href='/details'>
          <a>Faq</a>
        </Link>
      </div>
    </NavStyle>
  );
};

export default Nav;
